import React from 'react'
import {useNavigate, Router} from 'react-router-dom'


const ApplicationPost = (prop) => {
    const router = useNavigate()
    const goAppID = () => {
        router.push('application/${IDApplication')
    }
  return (
    <div className='post'>
        <div className='post__content'>
            <strong>{prop.post.IDApplication}</strong>
            <p>{prop.post.Name}</p>
            <strong>{prop.post.StatusHistory[prop.post.StatusHistory.length - 1]}</strong>
        </div>
    </div>
  )
}

export default ApplicationPost
